import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-light bg-secondary shadow p-0 row">
                    <div className="col-md-2 bg-primary"><span class="navbar-brand mb-0 h1 text-light text-center">Student Name</span></div>
                    <div className="col-md-10"></div>
                    
                </nav>

            </div>
        );
    }
}

export default Header;
